import React from "react";
import { Stack , Box} from '@mui/system';
import { imagesFibratec } from "../constants/FibratecPiscinas";
import SectionsCard from "../Components/SectionCard";
import {produtosFapac} from '../produtos/fapac/index'



export default function SwimmingPools(){

    return (
        <Box>
            <SectionsCard arrayOfImages={imagesFibratec}title='Piscinas Fibratec'/>

            <SectionsCard arrayOfImages={produtosFapac} title='Piscinas Fapac'/>


        </Box>
    )
}
